Em minha terra, a letra de um forró diz que "TODO CASTIGO PRA CORNO É POUCO"! Há 4 nos, Bolsonaro prometeu um Brasil aos seus eleitores iludidos, mas está entregando outro. Mesmo diante do descalabro desse (des)governo, milhões de eleitores pretendem repetir o voto alienado em 30 de outubro. Segue abaixo um pouco do que os brasileiros levaram no lombo, ao longo desses 4 anos de Bolsonaro, mas para alguns o castigo foi pouco!

Gasolina chegou a R$8,00;
Gás de cozinha R$ 130,00;
Dólar R$5,60;
Carne R$70,00 (kg);
Inflação batendo 10,16% (a deflação é uma farsa);
Óleo R$12,00
Ciro Nogueira no governo e mandando em Bolsonaro;
Fila do Osso em Cuiabá.
700 mil mortos pela Covid 19;
Mansão de 6 milhões do Flávio;
107 imóveis comprados com dinheiro de rachadinhas, 51 em dinheiro vivo;
Falta de vacinação;
Corrupção na compra de vacina;
Escândalo do tratoraço;
Corte de 92% da verba para Ciência e Tecnologia;
Bloqueio de R$ 2,5 bilhões das universidades e institutos federais;
Aumento da fome e miséria;
Aumento dos salários do presidente, do vice e dos generais de pijama, em 69%;
Destruição da Amazônia;
Mais de 3 Bilhões em emendas pra comprar o congresso pro Centrão;
Exoneração de todos os delegados da PF responsáveis por investigações envolvendo a familícia e/ou milicianos;
5 Bilhões pro Fundão eleitoral;
30 bilhões de orçamento secreto;
8 milhões para os desfiles de moto;
Sigilo de 100 anos no caso de corrupção da COVAXIN;
Maior escândalo de corrupção da história (a mídia chamou de “orçamento secreto”);
Corrupção no MEC;
Fome que avança forte em todo Brasil, 33 milhões passando fome.
42 bilhões de lucro da Petrobras no 2° bimestre, retirado das costas dos brasileiros para dar aos acionistas;
Maior gasto com o cartão corporativo da história 204 milhões e Sigilo de 100 anos;
Projeto que retira diretos do jovem aprendiz e comida de trabalhadores.
Retirada do art. 121 da Constituição Federal, com privatização dos correios, com perda de 1 bilhão de lucros ano;
Privatização de refinarias da Petrobrás;
Privatização da Eletrobrás e consequente aumento na conta de luz;
14.9 milhões de novos desempregados, maior taxa de todos dos últimos anos;
Queda de 6ª para 13ª economia;
Pior Índice de Desenvolvimento Humano (IDH) e o Brasil passou do 79º 2019 para o 84º lugar entre 189 países 2021;
Redução do poder de compra das CLASSE, sendo à mais afetada trabalhista, chegando em quase 70% de acordo IBGE, em alguns estados.
Desvalorização da moeda brasileira, que caiu 20,2%, enquanto as divisas dos 16 principais países emergentes subiram 1,2%. Em 2021, o real tombou 7,7%, essas moedas emergentes recuaram 1,4%;
R$ 1,2 bilhão gasto com alimentação do governo;
R$ 3,1 bilhões para gastos pessoas dos ministérios, sendo prediletos a mamata;
Desvio da verba de combate à covid para a compra de picanha e filé pros generais de pijama.
Privatizações e entreguismo criminoso de nossas estatais e setores estratégicos a nossa soberania crime de lesa pátria;
Mais de 160 pedidos de impeachment e tem muito mais coisas para acrescentar na lista, só pesquisarem.

